import React, { useState, useEffect } from 'react';
import BookList from './Components/BookList';
import './App.css';

function App() {
  const [databaseBooks, setBooks] = useState([]);

  useEffect(() => {
    fetch("/api/books/").then(response => response.json()).then(data => {
        setBooks(data.items)
    });
  }, []);

  return (
    <div class="App">
      <div class="App-header">Library</div>

      <div className="row">
        <div className="column">
          <p>testi</p>
        </div>
        <div className="column">
          <BookList books={databaseBooks} />
        </div>
      </div>

    </div>
  );
}

export default App;
